svg.script:
function init(evt) {
    if ( window.svgDocument == null )
        svgDocument = evt.target.ownerDocument;
    nightlayer = svgDocument.getElementById("layernight")
    daylayer   = svgDocument.getElementById("layersunny")
    dimlayer   = svgDocument.getElementById("layerdim")
    pinklayer  = svgDocument.getElementById("layertwilight")
    coldpixie  = svgDocument.getElementById("pixie-cold")
    coolpixie  = svgDocument.getElementById("pixie-cool")
    mildpixie  = svgDocument.getElementById("pixie-mild")
    hotpixie   = svgDocument.getElementById("pixie-hot")
    daydot   = svgDocument.getElementById("daylightselected")
    pinkdot  = svgDocument.getElementById("pinktwilightselected")
    greydot  = svgDocument.getElementById("dimtwilightselected")
    nightdot = svgDocument.getElementById("nightselected")
}

function setIndicator(newindicator) {
  daydot.setAttribute("display", "none")
  pinkdot.setAttribute("display", "none")
  greydot.setAttribute("display", "none")
  nightdot.setAttribute("display", "none")
  newindicator.setAttribute("display", "inline")
}

function setLayer(newlayer, newpixie) {
  daylayer.setAttribute("style", "display:none");
  nightlayer.setAttribute("style", "display:none")
  dimlayer.setAttribute("style", "display:none")
  pinklayer.setAttribute("style", "display:none")
  newlayer.setAttribute("style", "display:inline")

  hotpixie.setAttribute("style", "display:none")
  mildpixie.setAttribute("style", "display:none")
  coolpixie.setAttribute("style", "display:none")
  coldpixie.setAttribute("style", "display:none")
  newpixie.setAttribute("style", "display:inline")
}

function setDaylight() {
  setLayer(daylayer, hotpixie)
  setIndicator(daydot)
}

function setPinkTwilight() {
  setLayer(pinklayer, mildpixie)
  setIndicator(pinkdot)
}

function setDimTwilight() {
  setLayer(dimlayer, coolpixie)
  setIndicator(greydot)
}

function setNight() {
  setLayer(nightlayer, coldpixie)
  setIndicator(nightdot)
}
